INSERT INTO `packages` (`id`, `desti`, `agent_name`, `pname`, `description`, `adult_price`, `child_price`) VALUES
(31, 41, 'AgentName', 'Full Package', 'Destination Overview:\r\nBoracay, known as one of the most beautiful islands in the Philippines, boasts pristine white sandy beaches, crystal-clear turquoise waters, and vibrant nightlife. This tropical paradise offers a wide range of activities for every type of traveler, from thrilling water sports to serene beach relaxation.\r\n\r\nPackage Details:\r\n\r\nTransportation:\r\n\r\nRoundtrip Flight: Enjoy a hassle-free journey with roundtrip flights to Boracay from major airports.\r\nAirport Transfers: Upon arrival, be greeted by our friendly staff who will provide comfortable transfers to your accommodation.\r\n\r\nAccommodation:\r\nBeachfront Villa - Experience ultimate luxury with spacious accommodations overlooking the azure waters of Boracay.\r\n\r\nActivities:\r\nIndulge in a variety of exciting activities and experiences, guaranteed to make your Boracay getaway unforgettable.\r\n\r\nIsland Hopping Tour: Explore the neighboring islands of Boracay, including Puka Beach, Crystal Cove, and Magic Island, with snorkeling opportunities along the way.\r\nWater Sports Adventure: Dive into the crystal-clear waters and try your hand at exhilarating water sports such as parasailing, jet skiing, and banana boat riding.\r\nSunset Cruise: Relax and unwind on a picturesque sunset cruise around Boracay\'s coastline, complete with stunning views, refreshing cocktails, and live entertainment.\r\nScuba Diving Excursion: Discover the vibrant underwater world of Boracay with a guided scuba diving excursion, where you\'ll encounter colorful coral reefs, tropical fish, and fascinating marine life.\r\nSpa & Wellness Retreat: Treat yourself to a rejuvenating spa experience with traditional Filipino massages, body scrubs, and holistic treatments, guaranteed to leave you feeling relaxed and revitalized.\r\nOptional Add-Ons:\r\n\r\nCar Rental: Explore the island at your own pace with a convenient car rental option, allowing you to visit hidden gems and off-the-beaten-path attractions.\r\nScooter Rental: Experience the freedom of zipping around Boracay on a scooter, perfect for exploring the island\'s scenic roads and picturesque viewpoints.\r\nPackage Inclusions:\r\n\r\nRoundtrip Flights\r\nAirport Transfers\r\nAccommodation (Based on chosen option)\r\nSelected Activities and Excursions\r\nProfessional Guides and Instructors\r\nAll Entrance Fees and Taxes\r\nPackage Exclusions:\r\n\r\nMeals (unless specified)\r\nPersonal Expenses\r\nGratuities\r\n\r\nBooking Information:\r\nContact our friendly travel consultants to customize your Boracay travel package according to your preferences, budget, and schedule. Whether you\'re seeking adventure, relaxation, or a combination of both, we\'ll help you create the perfect itinerary for an unforgettable tropical escape to Boracay.\r\n', 500, 500),
(32, 41, 'AgentName', 'Family Package', 'Destination Overview:\r\nBoracay, hailed as one of the world\'s best islands, offers a perfect blend of stunning beaches, thrilling adventures, and vibrant nightlife. With its powdery white sand beaches and crystal-clear waters, Boracay promises an unforgettable tropical getaway for travelers of all ages.\r\n\r\nPackage Details:\r\n\r\nTransportation:\r\n\r\nRoundtrip Flight: Begin your journey with convenient roundtrip flights to Boracay from major airports.\r\nPrivate Transfers: Upon arrival, be whisked away in comfort with private transfers to your chosen accommodation.\r\n\r\nAccommodation:\r\nExclusive Villa - Enjoy the ultimate privacy and exclusivity in a stunning private villa, complete with your own infinity pool, personal butler service, and breathtaking sunset views.\r\nActivities:\r\nEmbark on a series of exhilarating adventures and unforgettable experiences that showcase the best of Boracay\'s natural beauty and vibrant culture.\r\n\r\nIsland Hopping Excursion: Explore the pristine islands and hidden coves surrounding Boracay on a private island hopping tour, with snorkeling, swimming, and beach picnics included.\r\nParasailing Adventure: Soar high above the azure waters of Boracay on a thrilling parasailing adventure, offering panoramic views of the island\'s coastline and vibrant marine life below.\r\nATV Jungle Safari: Embark on an adrenaline-pumping ATV jungle safari adventure through Boracay\'s lush rainforest trails, waterfalls, and scenic viewpoints.\r\nSunset Dinner Cruise: Sail into the sunset aboard a luxury yacht and indulge in a gourmet dinner experience, accompanied by live music, spectacular views, and romantic ambiance.\r\nCultural Experience: Immerse yourself in Boracay\'s rich cultural heritage with a traditional Filipino cooking class, cultural village tour, or cultural dance performance.\r\nOptional Add-Ons:\r\n\r\nSpa & Wellness Retreat: Treat yourself to a pampering spa and wellness retreat, with a variety of rejuvenating treatments, massages, and holistic therapies available.\r\nGolfing Experience: Tee off at Boracay\'s scenic golf courses, offering breathtaking ocean views and challenging fairways for golf enthusiasts of all levels.\r\nHelicopter Tour: Take your Boracay experience to new heights with a thrilling helicopter tour over the island, providing unparalleled aerial views of its stunning landscapes and landmarks.\r\nPackage Inclusions:\r\n\r\nRoundtrip Flights (Economy)\r\nPrivate Transfers\r\nAccommodation \r\nSelected Activities and Excursions\r\nProfessional Guides and Instructors\r\nAll Entrance Fees and Taxes\r\nPackage Exclusions:\r\n\r\nMeals (unless specified)\r\nPersonal Expenses\r\nGratuities\r\nBooking Information:\r\nContact our dedicated travel specialists to tailor your Ultimate Boracay Escape Package to your preferences, interests, and budget. Whether you\'re seeking adventure, relaxation, or a blend of both, we\'ll curate the perfect itinerary for an unforgettable luxury getaway to Boracay.', 1000, 1000),
(33, 42, 'AgentName', 'Full', 'Destination Overview:\r\nEl Nido, located in Palawan, Philippines, is renowned for its breathtaking limestone cliffs, crystal-clear waters, and pristine beaches. This tropical paradise offers a myriad of outdoor adventures, from island hopping and snorkeling to jungle treks and cave explorations, making it an ideal destination for nature lovers and adventure enthusiasts.\r\n\r\nPackage Details:\r\n\r\nTransportation:\r\n\r\nRoundtrip Flight: Begin your journey with roundtrip flights to El Nido from major airports, ensuring a seamless travel experience.\r\nAirport Transfers: Upon arrival, enjoy convenient transfers from the airport to your selected accommodation in El Nido.\r\nAccommodation:\r\nChoose from a range of eco-friendly resorts, beachfront cottages, and cozy guesthouses, providing comfortable accommodations amidst El Nido\'s stunning natural landscapes.\r\n\r\nAccommodation:\r\nBudget-Friendly Guesthouse - Travel on a budget without sacrificing comfort in a budget-friendly guesthouse, conveniently located near El Nido\'s main attractions and dining spots.\r\nActivities:\r\nEmbark on a series of thrilling adventures and immersive experiences that showcase the natural beauty and rich biodiversity of El Nido.\r\n\r\nIsland Hopping Tours: Explore El Nido\'s famous island-hopping routes, including visits to Big Lagoon, Small Lagoon, Secret Lagoon, and Shimizu Island, with opportunities for swimming, snorkeling, and beach picnics.\r\nSnorkeling Expedition: Discover vibrant coral reefs and colorful marine life on a guided snorkeling expedition to El Nido\'s best snorkeling spots, including Coral Garden and Twin Rocks.\r\nKayaking Adventure: Paddle through El Nido\'s scenic mangrove forests, hidden lagoons, and secluded beaches on a thrilling kayaking adventure, with options for solo or tandem kayaks.\r\nJungle Trekking: Embark on a guided jungle trekking adventure through El Nido\'s lush rainforests, waterfalls, and limestone cliffs, offering panoramic views of the surrounding landscapes.\r\nCave Exploration: Delve into El Nido\'s fascinating cave systems, including the famous Cathedral Cave and Cudugnon Cave, adorned with ancient rock formations and stalactites.\r\nOptional Add-Ons:\r\n\r\nScuba Diving Excursion: Dive into the underwater wonders of El Nido with a scuba diving excursion, exploring vibrant coral reefs, underwater caves, and diverse marine life.\r\nZipline Adventure: Soar above El Nido\'s scenic landscapes on a thrilling zipline adventure, offering breathtaking aerial views of the coastline and lush forests.\r\nSunset Cruise: Relax and unwind on a sunset cruise around El Nido\'s picturesque islands, with opportunities for swimming, snorkeling, and sunset cocktails.\r\nPackage Inclusions:\r\n\r\nRoundtrip Flights\r\nAirport Transfers\r\nAccommodation \r\nSelected Activities and Excursions\r\nProfessional Guides and Instructors\r\nAll Entrance Fees and Taxes\r\nPackage Exclusions:\r\n\r\nMeals (unless specified)\r\nPersonal Expenses\r\nGratuities\r\nBooking Information:\r\nContact our experienced travel consultants to customize your El Nido Adventure Package according to your preferences, interests, and budget. Whether you\'re seeking adrenaline-pumping adventures, tranquil beach escapes, or cultural experiences, we\'ll create the perfect itinerary for an unforgettable journey to El Nido.', 500, 500),
(34, 42, 'AgentName', 'Family', 'Destination Overview:\r\nEl Nido, situated in Palawan, Philippines, is celebrated for its mesmerizing limestone cliffs, clear turquoise waters, and secluded beaches. It offers an escape into nature\'s tranquility, ideal for those seeking relaxation, rejuvenation, and a deeper connection with the natural world.\r\n\r\nPackage Details:\r\n\r\nTransportation:\r\n\r\nRoundtrip Flight: Begin your journey with roundtrip flights to El Nido from major airports, ensuring a smooth start to your retreat.\r\nPrivate Transfers: Upon arrival, enjoy the comfort of private transfers from the airport to your chosen accommodation in El Nido.\r\nAccommodation:\r\nSelect from a range of luxurious resorts, boutique hotels, and eco-friendly lodges, each offering serenity and seclusion amidst El Nido\'s pristine landscapes.\r\n\r\nAccommodation:\r\nEco-Lodge - Immerse yourself in sustainable luxury at an eco-lodge, surrounded by lush rainforests and pristine beaches, with eco-friendly accommodations and eco-conscious practices.\r\nActivities:\r\nEmbark on a journey of relaxation, wellness, and self-discovery amidst the serene beauty of El Nido\'s natural landscapes.\r\n\r\nSpa & Wellness Retreat: Rejuvenate your body, mind, and soul with a bespoke spa and wellness retreat, offering holistic treatments, yoga sessions, and meditation practices amidst nature\'s tranquility.\r\nBeach Meditation & Yoga: Awaken your senses and find inner peace with guided meditation and yoga sessions on El Nido\'s secluded beaches, surrounded by the soothing sounds of the ocean and gentle sea breeze.\r\nNature Walks & Birdwatching: Explore El Nido\'s lush rainforests and coastal trails on guided nature walks, birdwatching excursions, and wildlife spotting adventures, immersing yourself in the beauty of nature.\r\nSunset Picnics: Savor romantic sunset picnics on secluded beaches, with gourmet meals prepared by private chefs, accompanied by sparkling wine and panoramic views of El Nido\'s stunning sunsets.\r\nStargazing & Bonfires: Spend evenings under the stars with stargazing sessions and beachfront bonfires, sharing stories and laughter with loved ones amidst the magic of El Nido\'s night skies.\r\nOptional Add-Ons:\r\n\r\nIsland Hopping & Snorkeling: Experience the beauty of El Nido\'s islands and marine life with guided island-hopping and snorkeling excursions, exploring hidden lagoons, coral reefs, and pristine beaches.\r\nPrivate Boat Charter: Charter a private boat for a customized island-hopping adventure, allowing you to explore El Nido\'s islands at your own pace, with personalized itineraries and exclusive access to secluded spots.\r\nSunset Sailing Cruise: Set sail on a private sunset sailing cruise around El Nido\'s islands, enjoying breathtaking views, refreshing cocktails, and romantic moments with your loved one.\r\nPackage Inclusions:\r\n\r\nRoundtrip Flights\r\nPrivate Transfers\r\nAccommodation (Based on chosen option)\r\nSelected Wellness Activities and Experiences\r\nProfessional Guides and Instructors\r\nAll Entrance Fees and Taxes\r\nPackage Exclusions:\r\n\r\nMeals (unless specified)\r\nPersonal Expenses\r\nGratuities\r\nBooking Information:\r\nContact our dedicated travel specialists to customize your El Nido Serenity Package according to your preferences, interests, and desired level of relaxation. Whether you\'re seeking a wellness retreat, romantic escape, or solo journey of self-discovery, we\'ll craft the perfect itinerary for an unforgettable serenity experience in El Nido.', 2000, 2000);

